import axios from "axios";
import React, { useEffect, useState } from "react";
import Dog from "../models/dog";

export default function IndexPage() {

    const [dogs, setDogs] = useState<Dog[]>([])

    useEffect(() => {
        fetchDogSearchResults(1);
    }, []);

    const fetchDogSearchResults = (pageNumber: Number) => {
        const headers = { 'x-api-key': 'ecd04f9a-fb4c-4fb2-b079-de2aaae47e5f' };
        fetch(`https://api.thedogapi.com/v1/images/search?limit=25&page=${pageNumber}&order=Desc`, { headers })
            .then(response => response.json())
            .then((data: Dog[]) => {
                debugger;
                var currentdogs = [...dogs];
                currentdogs.concat(data);
                setDogs(currentdogs);
            })
            .catch(error => {
                //this.setState({ errorMessage: error.message });
                console.error('There was an error!', error);
            });
    }

    return (
        <div>
            <h1>Hello, world!</h1>
        </div>
    );
}
